function InfoTooltip(props) {
  return(
    <section className='popup popup_opened'>
      <div className="popup__container">
        <button className={`popup__close-button popup__close-button_type_${props.name}`} type="button" onClick={props.onClose}></button>
        <div className='popup__success' style={{backgroundImage: `url(${props.image})`}}></div>
        <h3 className="popup__success-title">{props.text}</h3>
      </div>
    </section>
  )
}

export default InfoTooltip
